import React, { Component } from 'react';
import { Label,Menu,Grid,Header,Icon,Dropdown,Modal,Form,Button,Input } from 'semantic-ui-react';
import { connect } from 'react-redux';
import * as actions from '../actions';

import {SlideDown} from 'react-slidedown'
import '../../node_modules/react-slidedown/lib/slidedown.css'

class Drawer extends Component {



  render() {
    return (
      <Menu size='massive' style={{marginTop: -436,marginLeft: 950,height:600}} vertical>
      <Menu.Item style={{height:50,marginTop:10}}>
        <Icon onClick={this.props.closeDrawer} size="large" name="close" style={{marginRight:20}} />
        About
      </Menu.Item>
      <Menu.Item style={{height:50,marginTop:10}} name='inbox'  >
            Channel Details
        </Menu.Item>
      <Menu.Item style={{height:50,marginTop:10}} name='spam' >
            Highlights
      </Menu.Item>
      <Menu.Item style={{height:50,marginTop:10}} name='updates' a >
            Members
        </Menu.Item>
        <Menu.Item>
          <Input icon='search' placeholder='Search mail...' />
        </Menu.Item>
      </Menu>
      );
    };
  }

export default connect(null,actions)(Drawer);
